@-moz-document url("chrome://browser/content/browser.xul") {
  
    

    
    
    toolbar, menubar {border: none !important;}
    #toolbar-menubar * {background: none !important; text-shadow: none !important;}

    #nav-bar toolbarbutton {padding: 0 !important;}    
    
    

window:not([chromehidden~="toolbar"]) #urlbar-wrapper {
  clip-path: unset !important;
  -moz-margin-start: unset !important;
}
 
    
    /* extend window to borders */
    #browser-border-start, #browser-border-end {width: 0 !important; display: none !important;}
    #browser-bottombox {border: none !important;}
    #navigator-toolbox {margin: 0 -2px !important;}
    
    
    
    
    /* Toolbar buttons */
    
    #TabsToolbar .toolbarbutton-1:not([disabled=true]):hover,
#TabsToolbar .toolbarbutton-1[open],
#TabsToolbar .toolbarbutton-1 > .toolbarbutton-menubutton-button:not([disabled=true]):hover,
.tabbrowser-arrowscrollbox > .scrollbutton-up:not([disabled=true]):hover,
.tabbrowser-arrowscrollbox > .scrollbutton-down:not([disabled=true]):hover {
    background: none !important;
}
    
    
/* BACK AND FORWARD BUTTONS */
    
    #back-button {
        list-style-image:url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABIAAAASBAMAAACk4JNkAAAAD1BMVEUAAAD///////////////+P Qt5oAAAABXRSTlMATTwQJh6rDQkAAAAsSURBVAjXYyACMCvAWI4CUIaRoACMAWWxCEJZzIpoLIQs QgfCFITJCNsIAABL1QOzrhLPiQAAAABJRU5ErkJggg==') !important;      
        -moz-image-region: rect(0,18px,18px,0) !important;
        border: none !important;
        background: none !important;
        border-radius: 0 !important;
        padding: 0 !important;
        -moz-padding-start: 5px !important;
        -moz-padding-end: 0 !important;
  --toolbarbutton-hover-boxshadow: unset !important;
    }
    

#back-button:not([disabled="true"]):not([open="true"]):not(:active):hover > .toolbarbutton-icon {
  background: none !important;
}
    
#back-button:not([disabled="true"]):hover:active > .toolbarbutton-icon,
#back-button[open="true"] > .toolbarbutton-icon {
  background: none !important;
    border: none !important;
    box-shadow: none !important;
}
  #back-button:not([disabled="true"]):not([open="true"]):not(:active):hover > .toolbarbutton-icon {
  background: none !important;
    box-shadow: none !important;
  }
    
       #back-button > .toolbarbutton-icon {
          margin: 0 !important;
          padding: 0 6px 0 2px !important;
          box-shadow: unset !important;
          border: none !important;
          background: none !important;
          border-radius: 0 !important;
           background-clip: unset !important;
        }
    
    
    #forward-button {
        list-style-image:url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABIAAAASBAMAAACk4JNkAAAAD1BMVEUAAAD///////////////+P Qt5oAAAABXRSTlMATTwQJh6rDQkAAAArSURBVAjXYyAEmAxgLEYROEtQGc4CMmEsQQc4S8gAwcKQ VcYwRQTJNsIAACvtA1lZnwHgAAAAAElFTkSuQmCC') !important;
        -moz-image-region: rect(0,18px,18px,0) !important;
        border: none !important;
        background: none !important;
        border-radius: 0 !important;
        margin: 0 2px 0 0px !important;
        -moz-box-align: unset !important;
        padding: 0 !important;
    }

       #forward-button > .toolbarbutton-icon    {
           background-clip: unset !important;
          padding-left: 0px !important;
          padding-right: 4px !important;
          box-shadow: none !important;
           border-color: transparent !important;
          /* removing border makes it stretch vertically..? */
          background: none !important;
          border-radius: 0 !important;
        }
    
    #back-button[disabled], #forward-button[disabled] {display: none !important;} /* when there's nothing to go back to... */
    
    
.titlebar-placeholder, #titlebar-buttonbox-container #titlebar-buttonbox {display:none!important;}

#nav-bar {
    border: none !important;
    box-shadow: 0px 1px 0px #494949 inset !important; /*   line between the nav-bar and tabs */
    border-radius: 0;
    margin: 0px !important;
    height: 35px !important; 
    padding: 5px 5px 6px 8px !important; 
    background: -moz-linear-gradient(top, #3F3F3F, #333) !important;
}
/* fix for maximized */
/*window[sizemode="maximized"] #navigator-toolbox {margin-top: 0px;}*/
window[sizemode="maximized"] #TabsToolbar {margin-left: -8px !important;}

/*  bottom border color between the top toolbars and content */
#main-window #navigator-toolbox:after {
    background: #252525 !important;
    height: 1px !important;
}


/* urlbar */
#searchbar > .searchbar-textbox,
#urlbar {
    /*border-width: 1px !important;
    border-color: rgba(0, 0, 0, 0.2); */
