/* Tabs */

/* disable cloud tabstrip background */
#TabsToolbar:not(:-moz-lwtheme)::after {display: none;}

#tabbrowser-tabs {
    min-height: unset;
}
    

#TabsToolbar {
    background: transparent;
    margin: -1px -16px -1px -4px !important; /* move tabs into titlebar */
    padding: 0 !important;
} 
    
#TabsToolbar .tabbrowser-tab {
    -moz-border-top-colors: none;
    -moz-border-left-colors: none;
    -moz-border-right-colors: none;
    /*border-style: solid;
     border-width: 1px 0 0 1px; 
    border-color: rgba(255,255,255,.2); 
    margin-bottom: 0px; 
    */
    
    padding-bottom: 3px; /* move tab contents up a little */ 
/*    border-top: 1px solid #555 !important;
    border-left: 1px solid #555 !important; */
    /*max-height: 26px; */
    min-width: 24px;
    height: 29px;
    font-family: Segoe UI;
    font-size: 12px !important;
}

#TabsToolbar .tabbrowser-tab[last-visible-tab], #tabbrowser-tabs tab[first-tab='true'][last-tab='true'] {
    /* border-right: 1px solid #555 !important; */
}
#TabsToolbar .tabbrowser-tab[afterselected]{
    
}
    #TabsToolbar .tabbrowser-tab[last-visible-tab] {border-top-right-radius: 4px !important;}
    #TabsToolbar .tabbrowser-tab[first-visible-tab] {border-top-left-radius: 4px !important;}

    
#TabsToolbar .tabbrowser-tab[selected]{
    /* 
    background-clip: padding-box;
    border-color: rgba(255,255,255,.5); */
    color: #DDD;
    font-weight: 600;
    /*text-shadow: 0 0 20px rgba(150,150,150,1),
        0 0 16px rgba(150,150,150,1),
        0 0 12px rgba(175,175,175,.8),
        0 0 6px rgba(200,200,200,0.2) !important; */
    background: -moz-linear-gradient(top,#555,#3F3F3F) !important;
    border-top: 1px solid #4F4F4F !important;
    border-left: 1px solid #494949 !important;
    border-right: 1px solid #494949 !important;

}
#TabsToolbar .tabbrowser-tab:not([selected]) {
     background: -moz-linear-gradient(bottom, #0D0D0D, #333) !important;
     color: #777; 
     font-weight: 600;
}

/* Unvisited tabs */
 .tabbrowser-tab[unread="true"] {
     /*font-weight: 200;*/
     color: #777;
     font-style: italic;
     font-weight: 400 !important;
}

/* Restored tab that's not yet loaded */ 
.tabbrowser-tab[pending] .tab-text {
    font-weight: 400 !important;
    color: #777;
    font-style: italic;
}

#TabsToolbar .tabs-newtab-button:hover,
#TabsToolbar .tabbrowser-tab:hover:not([selected]),
#TabsToolbar .tabbrowser-tab:hover[unread="true"] {
    color: #EEE !important;
}

/* tab container */
#TabsToolbar .arrowscrollbox-scrollbox {
    padding: 0 2px 0 4px; /*fixme — too little left padding w/ many tabs */
}

#TabsToolbar .tab-background {
    margin: 0;
    background: transparent;
}
    
/* hides curved tab images */
#TabsToolbar .tab-background-start,
#TabsToolbar .tab-background-end {
    display:none;
}
#TabsToolbar .tab-background-middle { 
    background: none; /* needs to be here for tabs to be selectable! */
}

#TabsToolbar .tabbrowser-tab:after,
#TabsToolbar .tabbrowser-tab:before{
    display: none !important;
}



/* tab loading animation */
.tab-throbber[busy] {
list-style-image: url(data:image/png;base64,);
}
.tab-throbber[progress] {
list-style-image: url(data:image/gif;base64,);
}











